package hashTable;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;


public class hs_438todobug_FindAllAnagramsinaString {
    public static void main(String[] args) {
        int[] nums = {0,0,0,0};
        //System.out.println(a_18_4Sum.fourSum(nums, 0));
        List<Integer> list;

    }

    public List<Integer> findAnagrams(String s, String p) {

        HashMap<Integer, Integer> mapCur = new HashMap<>(), mapP = new HashMap<>();

        // step1
        for (int i = 0; i < p.length(); i++) {
            int cur = p.charAt(i) - 'a';
            if (mapP.containsKey(cur)) mapP.put(cur, mapP.get(cur) + 1);
            else mapP.put(cur, 1);
        }


        List<Integer> res = new ArrayList<>();
        for (int i = 0; i < s.length(); i++) {
            // mapCur add elemnets
            int cur = s.charAt(i) - 'a';
            if (mapCur.containsKey(cur)) mapCur.put(cur, mapCur.get(cur) + 1);
            else mapCur.put(cur, 1);


            if (i < p.length() - 1) continue;

            int start = i - p.length() + 1;
            if (isEqual(mapCur, mapP)) res.add(start);

            //delete mapCur elements
            int startChar = s.charAt(start) - 'a';
            if (mapCur.get(startChar) == 1) mapCur.remove(startChar);
            else mapCur.put(startChar, mapCur.get(startChar) - 1);
        }
        return res;
    }

    boolean isEqual(HashMap<Integer, Integer> map1, HashMap<Integer, Integer> map2) {
        for (Integer key : map1.keySet()) {
            if (!map2.containsKey(key) || map2.get(key) != map1.get(key)) return false;
        }
        return true;
    }

}
